pragma solidity ^0.8.0;

contract HotelBooking {
    
    address payable public owner;
    uint256 public pricePerNight;
    mapping(address => uint256) public bookings;
    
    event BookingMade(address guest, uint256 nights);
    
    constructor(uint256 _pricePerNight) {
        owner = payable(msg.sender);
        pricePerNight = _pricePerNight;
    }
    
    function book(uint256 nights) public payable {
        require(msg.value == nights * pricePerNight, "Insufficient payment");
        require(bookings[msg.sender] == 0, "Already booked");
        bookings[msg.sender] = nights;
        emit BookingMade(msg.sender, nights);
    }
    
    function cancel() public {
        require(bookings[msg.sender] > 0, "No booking found");
        uint256 refund = bookings[msg.sender] * pricePerNight;
        bookings[msg.sender] = 0;
        payable(msg.sender).transfer(refund);
    }
    
    function withdraw() public {
        require(msg.sender == owner, "Only owner can withdraw");
        payable(msg.sender).transfer(address(this).balance);
    }
    
}
